import React from "react";
import { Form } from "react-bootstrap";

function Login() {
  return (
    <div>
      {show == true && (
        <Alert
          serverity="error"
          className="fw-bold"
          style={{ fontSize: "25px" }}
        >
          All fields are required
        </Alert>
      )}
      <Row style={{ width: "100%" }}>
        <Col style={{ width: "50%" }}>
          <FormControl
            sx={{ border: "2px solid rgb(223,223,223)", width: "90%" }}
            className="p-3 my-3 py-5"
          >
            <h1>Login to neostore</h1>
            <TextField
              style={{
                width: "100%",
                border: "1px solid rgb(223,223,223)",
                outline: "none",
              }}
              className="my-4"
              id="outlined-basic"
              variant="outlined"
              placeholder="email"
              name="email"
              onChange={handleLoginData}
              required
              InputProps={{
                endAdornment: (
                  <InputAdornment position="start">
                    <EmailIcon />
                  </InputAdornment>
                ),
              }}
            ></TextField>
            <Form.Group className="mb-3" controlId="exampleForm.ControlInput2">
              <TextField
                style={{
                  width: "100%",
                  border: "1px solid rgb(223,223,223)",
                  outline: "none",
                }}
                className="my-4"
                id="outlined-basic"
                variant="outlined"
                placeholder="Password"
                name="password"
                type={password}
                onChange={handleLoginData}
                required
              ></TextField>
              <div
                style={{
                  position: "absolute",
                  rigth: "37px",
                  bottom: "140px",
                  fontSize: "21px",
                  cursor: "pointer",
                  fontWeight: "bold",
                }}
              >
                <i
                  onClick={Eye}
                  className={`fa ${eye ? "fa-eye-slash" : "fa-eye"}`}
                ></i>
              </div>
            </Form.Group>
          </FormControl>
        </Col>
      </Row>
    </div>
  );
}

export default Login;
